INSERT INTO store_product VALUES(23,'Wired Headphone','wired-headphone','products/25/11/11/Headphone-Zone-7HZ-Legato04-removebg-preview.png','Wired headphones deliver high-fidelity audio with zero latency, making them ideal for music lovers and professionals who prioritize sound quality. They offer reliable, plug-and-play performance without the need for charging, ensuring uninterrupted use for calls, gaming, or media. With durable builds and universal 3.5mm or USB-C connectivity, they remain a cost-effective choice for everyday listening.',1999.99,1,'2025-11-11 12:34:59.129502','2025-11-11 12:34:59.129532',3,13);
INSERT INTO store_product VALUES(24,'Wireless Headphone','wireless-headphone','products/25/11/11/Headphone-zone-focal-hadenys-galleryimage1-removebg-preview.png','Wireless headphones offer high-quality, immersive audio with the freedom of cord-free convenience, making them ideal for music, calls, and on-the-go use. They feature advanced technologies like active noise cancellation, long battery life (up to 50+ hours on some models), and seamless Bluetooth connectivity. Lightweight and comfortable, they deliver reliable performance for commuting, working, or relaxing  without sacrificing sound quality.',6798.82999999999992,1,'2025-11-11 12:37:05.448170','2025-11-11 12:37:05.448200',3,13);
INSERT INTO store_product VALUES(25,'Bluetooth Speaker','bluetooth-speaker','products/25/11/11/images-removebg-preview.png','Bluetooth speakers deliver high-quality, immersive audio with the freedom of wireless convenience, perfect for indoor and outdoor use. They offer features like long battery life, waterproof durability, and deep bass, ensuring powerful sound for music, parties, or travel. Easy to pair with smartphones and tablets, they provide seamless, portable listening anytime, anywhere.',2138.44000000000005,1,'2025-11-11 12:39:11.905120','2025-11-11 12:39:11.905187',3,13);
INSERT INTO store_product VALUES(26,'Iphone 17','iphone-17','products/25/11/11/iphone_17.jpg','The iPhone 17 features a 6.3-inch Super Retina XDR OLED display with 120Hz ProMotion, powered by the Apple A19 chip and running iOS 26. It boasts a 48MP dual-camera system, 8GB RAM, 256GB/512GB storage options, and a 3,692 mAh battery with fast charging and MagSafe support.',88000,1,'2025-11-11 12:43:17.902041','2025-11-11 12:43:17.902074',3,13);
INSERT INTO store_product VALUES(27,'Iphone 17 Pro','iphone-17-pro','products/25/11/11/iphone_17pro.jpg','The iPhone 17 Pro features a 6.3-inch Super Retina XDR OLED display with 120Hz ProMotion, powered by the Apple A19 Pro chip, 12GB RAM, and storage options up to 1TB. It boasts a professional-grade triple 48MP Pro Fusion camera system with 8x optical zoom, LiDAR scanner, and supports 4K/120fps Dolby Vision recording. With a 3,988 mAh battery (eSIM), USB-C fast charging, MagSafe, and iOS 26, it delivers top-tier performance and durability in an aerospace-grade aluminum design.',138999,1,'2025-11-11 12:44:47.451432','2025-11-11 12:44:47.451523',3,13);
INSERT INTO store_product VALUES(28,'Samsung S25','samsung-s25','products/25/11/11/samsung_s25.png','The Samsung Galaxy S25 features a 6.2-inch Dynamic LTPO AMOLED 2X display with a 120Hz refresh rate, powered by the Qualcomm Snapdragon 8 Elite chip, 12GB RAM, and up to 512GB storage. It boasts a triple rear camera system with a 50MP main sensor, 12MP ultrawide, and 10MP 3x telephoto, alongside a 12MP front camera, running Android 15 with One UI 7. The device includes a 4,000mAh battery with 25W fast charging, Qi2 wireless charging, IP68 rating, and is available in multiple colors like Navy, Icyblue, and Mint.',90000,1,'2025-11-11 12:47:00.204798','2025-11-11 12:47:00.204838',3,13);
INSERT INTO store_product VALUES(29,'Samsung Galaxy S25 Ultra 5G (Titanium Whitesilver, 256 GB)  (12 GB RAM)','samsung-galaxy-s25-ultra-5g-titanium-whitesilver-256-gb-12-gb-ram','products/25/11/11/samsung_s25.jpg','The Samsung Galaxy S25 Ultra 5G (Titanium Whitesilver, 256GB, 12GB RAM) features a 6.9-inch Dynamic AMOLED 2X display with 120Hz refresh rate and 2600 nits peak brightness, powered by the Snapdragon 8 Elite chip and Android 15 with One UI 7. It boasts a professional-grade quad camera system with a 200MP main sensor, 50MP ultrawide, dual telephoto lenses (3x and 5x optical zoom), and a 12MP front camera, supporting 8K video recording. The device includes a 5000mAh battery with 45W wired, 25W wireless (Qi2), and reverse wireless charging, along with IP68 rating, ultrasonic fingerprint sensor, and advanced Galaxy AI features.',120000,1,'2025-11-11 12:50:58.406786','2025-11-11 12:50:58.406832',3,13);
INSERT INTO store_product VALUES(30,'JBL PARTYBOX ENCORE ESSENTIAL HERO','jbl-partybox-encore-essential-hero','products/25/11/11/JBL_PARTYBOX_ENCORE_ESSENTIAL_HERO_1605x1605px.webp','The JBL PARTYBOX Encore Essential HERO delivers powerful 100W JBL Original Pro Sound with deep bass and a dynamic light show that syncs to the beat, perfect for immersive party experiences. It features Bluetooth 5.1, USB and AUX connectivity, a wired mic input for karaoke, and an IPX4 splash-proof design for added durability. With up to 6 hours of playtime and a portable handle, it''s ideal for on-the-go entertainment.',35672,1,'2025-11-11 12:53:30.217403','2025-11-11 12:53:30.217458',3,13);
INSERT INTO store_product VALUES(31,'Bluetooth EarPod','bluetooth-earpod','products/25/11/11/MUVX3-removebg-preview_bUhcuWE.png','Bluetooth EarPods deliver a secure, ergonomic fit with enhanced sound isolation and rich audio quality, designed to sit comfortably in the ear canal for extended use. They offer seamless wireless connectivity, crisp calls, and are ideal for commuting, workouts, and daily listening.',7890,1,'2025-11-11 12:56:55.542991','2025-11-11 12:56:55.543038',3,13);
INSERT INTO store_product VALUES(32,'Sony-V13 High-Power Party Speaker with BLUETOOTH Technology','sony-v13-high-power-party-speaker-with-bluetooth-technology','products/25/11/11/Sony-V13_High-Power_Party_Speaker_with_BLUETOOTH_Technology.avif','The Sony MHC-V13 High-Power Party Speaker delivers immersive, room-filling sound with a JET BASS BOOSTER for deep, punchy bass and two upward-facing tweeters for clear, dynamic audio. It features a vibrant multicolor light show that syncs to the beat, Bluetooth connectivity, NFC pairing, and wireless Party Chain to link up to 50 compatible speakers. With microphone and guitar inputs, the Fiestable app for karaoke scoring and playlist control, and a built-in handle for portability, it''s the ultimate party companion.',40566,1,'2025-11-11 12:58:24.773694','2025-11-11 12:58:24.773726',3,13);
INSERT INTO store_product VALUES(33,'Sony-V83D High-Power Party Speaker with BLUETOOTH Technology','sony-v83d-high-power-party-speaker-with-bluetooth-technology','products/25/11/11/Sony-V83D_High-Power_Party_Speaker_with_BLUETOOTH_Technolog.avif','The Sony MHC-V83D High-Power Party Speaker delivers immersive, omnidirectional sound with 150W output, featuring JET BASS BOOSTER for deep bass and four high-efficiency tweeters for wide sound coverage. It includes dynamic multicolor party lights, Bluetooth connectivity, NFC pairing, HDMI output for TV audio, and dual microphone/guitar inputs for karaoke and live performance. Controlled via the Fiestable app, it supports gesture control, DJ effects, Taiko drum mode, and can wirelessly link with up to 50 compatible speakers for synchronized audio and lighting.',32567,1,'2025-11-11 13:00:20.886038','2025-11-11 13:00:20.886074',3,13);
INSERT INTO store_product VALUES(34,'Jack and Jhon Flip','jack-and-jhon-flip','products/25/11/12/jackandjhonsFlip.jpg','"Jack and Jhon Flip" likely refers to a misspelling of either Jack & Jones flip flops, a line of men''s casual footwear, or the J-K flip-flop, an electronic circuit named after engineer Jack Kilby. Alternatively, it may be a typo for adult content involving "flip-fuck" scenes featuring performers named Jack and John.',1342,1,'2025-11-12 05:14:34.270977','2025-11-12 05:14:34.271043',7,14);
