INSERT INTO store_product VALUES(44,'Sony-V13 High-Power Party Speaker with BLUETOOTH Technology','sony-v13-high-power-party-speaker-with-bluetooth-technology','products/25/11/12/Sony-V13_High-Power_Party_Speaker_with_BLUETOOTH_Technology.avif','The Sony MHC-V13 High-Power Party Speaker delivers immersive, room-filling sound with a JET BASS BOOSTER for deep, punchy bass and two upward-facing tweeters for clear, dynamic audio. It features a vibrant multicolor light show that syncs to the beat, Bluetooth connectivity, NFC pairing, and wireless Party Chain to link up to 50 compatible speakers. With microphone and guitar inputs, the Fiestable app for karaoke scoring and playlist control, and a built-in handle for portability, it''s the ultimate party companion.',40566,1,'2025-11-12 07:13:59.172844','2025-11-12 07:13:59.172918',1,15);
INSERT INTO store_product VALUES(45,'Bluetooth EarPod','bluetooth-earpod','products/25/11/12/MUVX3-removebg-preview.png','Bluetooth EarPods deliver a secure, ergonomic fit with enhanced sound isolation and rich audio quality, designed to sit comfortably in the ear canal for extended use. They offer seamless wireless connectivity, crisp calls, and are ideal for commuting, workouts, and daily listening.',7890,1,'2025-11-12 07:15:20.046971','2025-11-12 07:15:20.047009',1,15);
INSERT INTO store_product VALUES(46,'JBL PARTYBOX ENCORE ESSENTIAL HERO','jbl-partybox-encore-essential-hero','products/25/11/12/JBL_PARTYBOX_ENCORE_ESSENTIAL_HERO_1605x1605px.webp','The JBL PARTYBOX Encore Essential HERO delivers powerful 100W JBL Original Pro Sound with deep bass and a dynamic light show that syncs to the beat, perfect for immersive party experiences. It features Bluetooth 5.1, USB and AUX connectivity, a wired mic input for karaoke, and an IPX4 splash-proof design for added durability. With up to 6 hours of playtime and a portable handle, it''s ideal for on-the-go entertainment.',35672,1,'2025-11-12 07:16:39.631110','2025-11-12 07:16:39.631240',1,15);
INSERT INTO store_product VALUES(47,'Wireless HeadPhone','wireless-headphone','products/25/11/12/Headphone-zone-focal-hadenys-galleryimage1-removebg-preview.png','Wireless headphones offer high-quality, immersive audio with the freedom of cord-free convenience, making them ideal for music, calls, and on-the-go use. They feature advanced technologies like active noise cancellation, long battery life (up to 50+ hours on some models), and seamless Bluetooth connectivity. Lightweight and comfortable, they deliver reliable performance for commuting, working, or relaxing  without sacrificing sound quality.',6798,1,'2025-11-12 07:18:03.839479','2025-11-12 07:18:03.839516',1,15);
INSERT INTO store_product VALUES(49,'Wired HeadPhone','wired-headphone','products/25/11/12/Headphone-Zone-7HZ-Legato04-removebg-preview_4QReG7V.png','Wired headphones deliver high-fidelity audio with zero latency, making them ideal for music lovers and professionals who prioritize sound quality. They offer reliable, plug-and-play performance without the need for charging, ensuring uninterrupted use for calls, gaming, or media. With durable builds and universal 3.5mm or USB-C connectivity, they remain a cost-effective choice for everyday listening.',1999.99,1,'2025-11-12 07:40:12.271621','2025-11-12 07:40:12.271646',1,15);
INSERT INTO store_product VALUES(50,'Scents The Rich Perfume','scents-the-rich-perfume','products/25/11/12/41cixgFl2UL.webp','Scents Perfume refers to fragrances crafted from a blend of natural and synthetic aromatic compounds designed to emit a pleasant and lasting aroma. These perfumes are composed of top, heart, and base notes that evolve over time, creating a unique olfactory experience tailored to personal style and mood.',999,1,'2025-11-12 09:26:54.514125','2025-11-12 09:26:54.514156',8,16);
INSERT INTO store_product VALUES(51,'Royal OUD Intense Rich perfume','royal-oud-intense-rich-perfume','products/25/11/12/perfume1.jpg','Royal OUD Intense is a luxurious, unisex fragrance that opens with vibrant citrus and spicy notes of lemon, pink pepper, and bergamot, evolving into a heart of cedar, galbanum, and angelica root, all grounded by a rich, woody base of oud, sandalwood, and musk. Crafted by Creed, this Eau de Parfum embodies sophistication and warmth, making it ideal for evening wear or special occasions, with a lasting scent that projects elegance and depth.',3872,1,'2025-11-12 09:34:46.659512','2025-11-12 09:34:46.659538',8,16);
INSERT INTO store_product VALUES(52,'Shadow Intense India''s Strongest Perfume','shadow-intense-indias-strongest-perfume','products/25/11/12/ShadowIntense50ml-min.webp','Shadow Intense by OG Luxury is an extrait de parfum with a 40% concentration, opening with an enigmatic blend of lavender and black pepper, evolving into rich notes of leather and amber for a bold, mysterious character. Designed to last up to 24 hours, this intense fragrance offers a luxurious, long-lasting scent ideal for any occasion and those seeking a powerful, unforgettable presence.',2435,1,'2025-11-12 09:38:22.329504','2025-11-12 09:38:22.329525',8,16);
INSERT INTO store_product VALUES(53,'Giovane ROSE Perfume','giovane-rose-perfume','products/25/11/12/e8e6f820ad62e3e491875fffb49d809c.webp','Giovane ROSE Perfume captures the essence of a blooming garden with its lush, velvety rose heart, wrapped in soft green and powdery notes for a romantic, timeless allure. Its delicate balance of freshness and warmth evokes elegance and femininity in every spritz.',2500,1,'2025-11-12 12:53:46.820747','2025-11-12 12:53:46.820787',8,16);
INSERT INTO store_product VALUES(54,'SILLAGE PREMIUM PERFUME','sillage-premium-perfume','products/25/11/12/TCB_3864_1_800x.webp','SILLAGE PREMIUM PERFUME by Art & Parfums is a unisex fragrance that opens with a trail of oud, saffron, and violet, evolving into a heart of jasmine, olibanum, and raspberry before settling on a warm, sensual base of musk, vanilla, and amber. It embodies a lingering presenceless a memory and more a bold statement of beingcrafted to evoke the lasting imprint of light, touch, and emotion.',3000,1,'2025-11-12 12:56:57.435306','2025-11-12 12:56:57.435344',8,16);
INSERT INTO store_product VALUES(55,'Titan Edge Ceramic Quartz in Rich Black Dial Watch for Men','titan-edge-ceramic-quartz-in-rich-black-dial-watch-for-men','products/25/11/12/titan_watch.webp','The Titan Edge Ceramic Quartz in Rich Black Dial Watch for Men features a sleek, minimalist design with a scratch-resistant black ceramic case and strap, paired with a rich black dial and elegant rose gold-toned hands. With an ultra-slim 4.2 mm profile, sapphire crystal glass, and 30-meter water resistance, it combines lightweight durability with refined sophistication.',37342,1,'2025-11-12 13:05:14.490480','2025-11-12 13:05:14.490528',5,17);
INSERT INTO store_product VALUES(56,'Titan Edge Ceramic Quartz in Arctic White Dial Watch for Men','titan-edge-ceramic-quartz-in-arctic-white-dial-watch-for-men','products/25/11/12/titan_white1.webp','The Titan Edge Ceramic Quartz in Arctic White Dial Watch for Men features a minimalist round dial with Roman numerals at 6 and 12, set within a sleek 47 mm white ceramic case and paired with a matching ceramic strap for a refined, modern look. Protected by scratch-resistant sapphire crystal and boasting an ultra-slim profile, it combines elegant design with durable, everyday functionality.',35674,1,'2025-11-12 13:07:23.254122','2025-11-12 13:07:23.254158',5,17);
INSERT INTO store_product VALUES(57,'DIOR HOME PERFUME','dior-home-perfume','products/25/11/12/Y0997193_C099700665_E02_RHC.webp','DIOR HOME PERFUME encompasses a luxurious collection of scented lifestyle creations, including candles, diffusers, and home fragrances, crafted under La Collection Prive Christian Dior to evoke elegance and sensory richness. Featuring iconic scents like Oud Ispahan, Ambre Nuit, and Jardin dOrangers, these home perfumes blend couture artistry with fine fragrance to transform living spaces into immersive olfactory experiences.',3500,1,'2025-11-12 15:43:47.954780','2025-11-12 15:43:47.954823',8,17);
